import React from 'react';

import './Form.css';

const saveTodo = (event) =>{
    event.preventDefault();
    console.log("Clicked~");
}

function Form() {
    return (
        <form className="form">
            <label className='label'>What to do?</label>
            <input className='input' type="text"></input>
            <button className='button' onClick={saveTodo}>Add Todo</button>
        </form>
    );
}

export default Form;
